import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src='https://i.pinimg.com/originals/33/b8/69/33b869f90619e81763dbf1fccc896d8d.jpg' width='100px' />
      </header>

      <nav className="header">
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
      </nav>

      <div>
        Main content
      </div>


    </div>
  );
}

export default App;
